import React from "react";


export function PropPush(props){
   const explore = (eve) =>{
       console.log("entered")
       props.history.push("customer")
       eve.preventDefault()
   }
   return(
       <div>

           <form>

           </form>
           <input type="submit" value="change" onChange={(eve) => {
               console.log("entered")
               props.history.push("customer")
               eve.preventDefault()
           }}/>
       </div>
   )
}
